// import Home from './Home';
import {Switch,Router} from 'react-router-dom';
const Service = () => {
    return ( 
      <>
      <div className="my-5">
        <h1 className="tab-center">Our Services</h1>
      </div>
      <div class="row">
        <div className="col-10 mx-auto">
          <div className="row"></div>
        </div>
      </div>
         
  </>
  
    );
  }
  
  export default Service;
